import CenterMobileMain from "./CenterMobileMain";
import CenterMobileSubject from "./CenterMobileSubject";

 export const Mobile = React.createContext();

export function Center() {
 const [state, setstate] = useState(true);
  const setFun = () => {
    setstate((pre)=>pre = false)
  }

  return (

    <>
      <Mobile.Provider value={{set:setFun} }>


        {state ? (<CenterMobileMain />
        ) : (<CenterMobileSubject />)}

        </Mobile.Provider>
    </>
  );
}
